const Loadable = (Component: FC<any>) =>
  // eslint-disable-next-line @typescript-eslint/no-explicit-any
  forwardRef((props: any, ref) => (
    <Suspense fallback={<></>}>
      <Component {...props} ref={ref} />
    </Suspense>
  ));

export default Loadable;
